import { Carousel } from "react-responsive-carousel";
import img1 from '../assets/3.jpg';
import img2 from '../assets/4.jpg';
function Services() {
  return (
    <div className='services'>
      <Carousel>
        <div>
            <img src={im} alt="" />
        </div>
      </Carousel>
    </div>
  )
}

export default Services
